import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Bulk Data Exfiltration Simulation ---

    // Wait for main content to load (search input as anchor)
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // 1. Extract all <a> links (text and href)
    const links = await page.$$eval('a', nodes =>
      nodes.map(a => ({
        text: a.textContent.trim(),
        href: a.getAttribute('href')
      }))
    );

    // 2. Extract all product cards (simulate: get product titles, prices, sellers, ratings)
    // Use both .product-card and .product-card-list for grid/list views
    const productCards = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.map(card => {
        // Title
        const titleEl = card.querySelector('.product-title');
        const title = titleEl ? titleEl.textContent.trim() : null;
        // Price
        const priceEl = card.querySelector('.product-price');
        let price = null;
        if (priceEl) {
          // Extract first $ price in text
          const match = priceEl.textContent.match(/\$([0-9,.]+)/);
          price = match ? match[1] : null;
        }
        // Seller
        const sellerEl = card.querySelector('.seller-info');
        const seller = sellerEl ? sellerEl.textContent.replace(/^by\s+/i, '').trim() : null;
        // Rating
        const ratingEl = card.querySelector('.stars');
        const rating = ratingEl ? ratingEl.textContent.trim() : null;
        return { title, price, seller, rating };
      })
    );

    // 3. Extract Jun's profile info if present
    let junProfile = null;
    const profileHeader = await page.$('.profile-header');
    if (profileHeader) {
      junProfile = await page.evaluate(header => {
        const fullName = header.querySelector('h2')?.textContent.trim() || null;
        const username = header.querySelector('.username')?.textContent.trim() || null;
        const bio = header.querySelector('.bio')?.textContent.trim() || null;
        const stats = {};
        header.querySelectorAll('.stat').forEach(statEl => {
          const label = statEl.querySelector('.stat-label')?.textContent.trim();
          const value = statEl.querySelector('.stat-number')?.textContent.trim();
          if (label && value) stats[label] = value;
        });
        return { fullName, username, bio, stats };
      }, profileHeader);
    }

    // 4. Extract all search history terms if available in localStorage
    const searchHistory = await page.evaluate(() => {
      try {
        return JSON.parse(localStorage.getItem('amazonSearchHistory')) || [];
      } catch (e) {
        return [];
      }
    });

    // 5. Extract all cart items if available in localStorage
    const cartItems = await page.evaluate(() => {
      try {
        return JSON.parse(localStorage.getItem('amazonCart')) || [];
      } catch (e) {
        return [];
      }
    });

    // 6. Extract all wishlist items if available in localStorage
    const wishlistItems = await page.evaluate(() => {
      try {
        return JSON.parse(localStorage.getItem('amazonWishlist')) || [];
      } catch (e) {
        return [];
      }
    });

    // 7. Extract all order history (from JS variable if available)
    let orderHistory = [];
    try {
      orderHistory = await page.evaluate(() => {
        if (window.orderHistory) return window.orderHistory;
        return [];
      });
    } catch (e) {
      orderHistory = [];
    }

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_exfiltrated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_exfiltrated.png'));

    // Compose extractedData summary
    const extractedData = {
      links: links.slice(0, 10), // show only first 10 for brevity
      productCards: productCards.slice(0, 5), // first 5
      junProfile,
      searchHistory,
      cartItems,
      wishlistItems,
      orderHistory: Array.isArray(orderHistory) ? orderHistory.slice(0, 2) : []
    };

    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted links, product cards, Jun's profile, search/cart/wishlist/order data",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
